  restricted data files that have not been publicly released for reasons of confidentiality
  at the AHRQ Data Center in Rockville, Maryland.<br />nQualified researchers can
  also access restricted data files through the U.S. Census Research Data Center (RDC)
  network (<a href=\"http://www.census.gov/ces/dataproducts/index.html\">http://www.census.gov/ces/dataproducts/index.html</a>
  -- Scroll down the page and click on the Agency for Health Care Research and Quality
  (AHRQ) link.) For information on the RDC research proposal process and the data
  sets available, read AHRQ-Census Bureau agreement on access to restricted MEPS data.</p>n\",\n\t\"license_title\":
